import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Perform a search first to get to a page with price filter
    await page.waitForSelector('#searchInput', { timeout: 5000 });
    await page.fill('#searchInput', 'electronics');

    await page.waitForSelector('.search-btn', { timeout: 5000 });
    await page.click('.search-btn');

    // Wait for search results to load
    await page.waitForSelector('.products-grid, .products-list', { timeout: 5000 });

    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_search_results.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_search_results.png'));

    // Apply price range filter
    await page.waitForSelector('#minPrice', { timeout: 5000 });
    await page.fill('#minPrice', '50');

    await page.waitForSelector('#maxPrice', { timeout: 5000 });
    await page.fill('#maxPrice', '200');

    await page.waitForSelector('.apply-filter', { timeout: 5000 });
    await page.click('.apply-filter');

    // Wait for filter to be applied and results to update
    await page.waitForTimeout(1000);

    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_price_filter_applied.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_price_filter_applied.png'));

    // Extract product count and prices to verify filter was applied
    const productCount = await page.$$eval('.product-card, .product-card-list', elements => elements.length);

    const productPrices = await page.$$eval('.product-price', elements => 
      elements.map(el => {
        const priceText = el.textContent.replace('$', '');
        return parseFloat(priceText);
      })
    );

    // Verify all prices are within the filtered range
    const allInRange = productPrices.every(price => price >= 50 && price <= 200);

    return {
      success: true,
      action: "Applied price range filter ($50-$200) to search results",
      extractedData: {
        productCount,
        priceRangeValid: allInRange,
        minPriceFound: Math.min(...productPrices),
        maxPriceFound: Math.max(...productPrices)
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to apply price range filter",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
